■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>落雷により発生する雷サージから、電子機器を保護!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5086/0855bh-01.jpg" width="600" height="1188"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">※雷サージとは<br>落雷時に発生する異常電圧・異常電流のことで電流ラインやテレビラインを伝わって、テレビ、BDレコーダーなどの電子機器を破壊する原因となります。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="968" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5086/0855bh-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">雷サージをバイパス回路により迂回させ、電子機器を保護する方式(バイパスアレスタ方式)ですので、保護性能が優れています。アースを接地しなくても耐雷効果があります。</font></td></tr></table><br><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">雷サージをバイパス回路により迂回させ、電子機器を保護する方式(バイパスアレスタ方式)ですので、保護性能が優れています。アースを接地しなくても耐雷効果があります。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">(H)92.5×(W)48.2×(D)26.0mm(端子含めず)</font><br><font color="#333333" size="-1">個装サイズ：6×5×13cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">0.1kg</font><br><font color="#333333" size="-1">個装重量：400g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">定格:AC125V 15A <br>雷防護方法:バイパスアレスタ法 <br>パイロットランプ:点灯(保護)/消灯(無保護) <br>アース端子:M4ねじ <br>AC入力端子:ACプラグ(壁面用) <br>AC出力端子:2極(2口) <br>TV端子:F型 <br> <br>取説は台紙に記載</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
